FastClick.attach(document.body);

const YouTube = 'data:image/png;base64,';
const Tumblr = 'data:image/png;base64,';
const Twitter = 'data:image/png;base64,';

const base64Icons = {
    'youtube': YouTube,
    'tumblr': Tumblr,
    'twitter': Twitter,
};

let previewVideo = null;
const vw = window.innerWidth - 50;

const vm = new Vue({
    el: '#app',
    data: {
        link: 'https://youtu.be/Xg7tcni_6-4',
        vw: vw,
        vh: Math.floor(vw * 9 / 16),
        app: {
            title: 'MUI Downloader'
        }
    },
    mounted: function() {
        this.$nextTick(function(){
            initCanvas();
            previewVideo = document.querySelector('#previewVideo');
        });
        this.$nextTick(function() {
            $notify('exec', { func: 'ready' });
        });
    }
});

function initCanvas () {
    let glpi = new GLParticleIcons('c', [
        base64Icons['youtube'],
        base64Icons['tumblr'],
        base64Icons['twitter'],
    ]);

    window.addEventListener("click", function (event) {
        glpi.change();
    });
}

function updateVideo (v) {
    previewVideo.poster = v.poster;
    previewVideo.src = v.src;
    previewVideo.play();
}

